import React from 'react';
import '../../App.css';

function Test() {
    return (
        <div className="area"> 
    <div className="container">
     <div className="area-grid">  
    
    <div className="grid-item-text">
    <img src="images-notifier/img2.jpg" alt=""  />
    </div>
    <div className="grid-item-img"> 
    lGet immediate exposure with your first upload. 
    Our Pulse algorithm surfaces new photographs and 
    photographers, ensuring your photos are seen by the 
    community so you receive valuable feedback on day one.
    </div>
    
     </div> 
     </div>
</div>

    );
  }
  
  export default Test;
